    'SUB_021_001': 'Mars Operation\'s \'Calculation Speed Improvement\' Learning Technique',
    'SUB_021_002': 'Step-by-step Instructions for \'Calculation Speed Improvement\'',
    'SUB_021_003': 'The Use and Effects of \'Standard Division 100\'',
    'SUB_021_004': 'Next',
    'SUB_021_005': 'Back',
    'SUB_021_006': '1. Mars Operation\'s \'Calculation Speed Improvement\' Learning Technique',
    'SUB_021_007': '\'Calculation Speed Improvement\' is a practice for solving adding, subtracting, multiplying, and dividing problems rapidly. It\'s a technique that attracts attention around the globe which not only improves calculation proficiency, but also activates children\'s brain.',
    'SUB_021_008': 'This technique trains children\'s brain by rapidly calculating simple problems rather than wrestling with difficult ones.',
    'SUB_021_009': 'Training the brain in such way boosts confidence, allowing children to face difficult problems without feeling reluctant.',
    'SUB_021_010': 'It is important to record calculation time for so that children can see their record to feel that they are improving on a daily basis. Also, it is important to increase the number of problems as they advance higher.',
    'SUB_021_011': 'The final goal is to solve 100 adding, subtracting, multiplying problems in 2 minutes and get all the answers correct.',
    'SUB_021_012': '2. Step-by-step Instructions for \'Calculation Speed Improvement\'',
    'SUB_021_013': '10-Slot Calculation(Addition, Subtraction, Multiplication)',
    'SUB_021_014': 'Look at the numbers on the left and on the top, and perform adding, subtracting, multiplying 10 times. It is okay to start out slow. Repeat until 10 calculations can be done in 20 seconds.',
    'SUB_021_015': '30-Slot Calculation(Addition, Subtraction, Multiplication)',
    'SUB_021_016': 'This calculation has 3 times the amount of 10-Slot Calculation. The main task of this calculation is maintaining concentration to last a minute. Repeat until 30 calculations can be done in 1 minute.',
    'SUB_021_017': '50-Slot Calculation(Addition, Subtraction, Multiplication)',
    'SUB_021_018': 'This is the step where basic calculation speed is increased. 30-Slot Calculation allowed 2-second calculation per slot. The goal is to increase calculation speed to 1.8 seconds per slot. Repeat until 50 calculations can be done in 1 minute 30 seconds.',
    'SUB_021_019': '100-Slot Calculation(Addition, Subtraction, Multiplication',
    'SUB_021_020': 'This is the final step to increase calculation speed to 1.5 seconds per slot. The goal is to be able to immediately think of the answer just by looking at 2 numbers.',
    'SUB_021_021': 'The Use and Effects of \'Standard Division 100\'',
    'SUB_021_022': 'Standard Division 100',
    'SUB_021_023': 'Division answer is produced based on multiplication. For example, 8÷2 can be intepreted as 2X□=8, fill in the blank to get 2X4=8, so it becomes 8÷2=4. Like the example, there are a total of 460 types of calculations that can be done to find the answer to a division problem based on 1 basic multiplication. There are 90 types of division problem with whole number answer (Type A), 270 types of division with no subtraction when finding the remainder (Type B), and 100 types of division with subtraction when finding the remainder (type C).',
    'SUB_021_024': '100 Type C division types are the best operations for training children\'s brain. ',
    'SUB_021_025': 'Because it is impossible to do 100 calculations in 5 minutes if they are skilled in addition, subtraction, multiplication calculation, and not trained to concentrate. However, the time will come where they will be able to do them in 5 minutes with no difficulty.',
    'SUB_022_001': 'Memorization Improvement Result',
    'SUB_022_002': 'Keep working on solving given problems quickly and accurately to collect (icon).',
    'SUB_022_003': 'You got all the answers correctly.',
